import React from 'react';

function VideoStream() {
  return (
    <div>
      <h1>Real-time Object Detection</h1>
      <img
        src="http://localhost:5000/video_feed"
        alt="Video feed"
        style={{ width: '100%', height: 'auto' }}
      />
    </div>
  );
}

export default VideoStream;
